import './App.css';
import React , {Component} from "react"
import { NavBar } from './components/NavBar';
import { News } from './components/News';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

export default class App extends  Component {
  render() {
    return(
      <div>
      <BrowserRouter>
      <NavBar/>
      <Routes>
        <Route exactexact path="/" element={<News pageSize = {6} country="sa" category = "general"/>}></Route>
        <Route exactexact path="/business"element = {<News pageSize = {6} country="sa" category = "business"/>}></Route>
        <Route exactexact path="/entertainment" element = {<News pageSize = {6} country="sa" category = "entertainment"/>}></Route>
        <Route exactexact path="/health" element = {<News pageSize = {6} country="sa" category = "health"/>}></Route>
        <Route exactpath="/science"element = {<News pageSize = {6} country="sa" category = "science"/>}></Route>
        <Route exactpath="/sports"element = {<News pageSize = {6} country="sa" category = "sports"/>}></Route>
        <Route exactpath="/technology"element = {<News pageSize = {6} country="sa" category = "technology"/>}></Route>
        </Routes>
       </BrowserRouter>
       </div>
    )
  }
}
